    <StrictMode>
     <>
     <User name='hosssein' age='21' job='front Developer'/>
     <User name='AmirMohammad' age= '17' job='mechanic'/>
     <User name='Amir' age='22' job='trade'/>
     </> 
    </StrictMode>
  );
